import React from "react";

const Navigation = (props) => {
  return (
    <nav>
      <img src="./src/img/logo.png" alt="SS System 13 Logo" />
      <ul>
        <a href="./index.html">
          <li>Home</li>
        </a>
        <a href="#">
          <li className="active">System</li>
        </a>
        <a href="./github.html">
          <li>Github</li>
        </a>
        <a href="https://ssdevelopers.xyz">
          <li>Portals</li>
        </a>
      </ul>
    </nav>
  );
};

export default Navigation;
